import React, { PureComponent } from "react";


import { Card, CardBody, Col, Button, ButtonToolbar,Input } from 'reactstrap'
import { Table, Thead, Tbody, Tr, Th, Td } from 'react-super-responsive-table'
import 'react-super-responsive-table/dist/SuperResponsiveTableStyle.css'

import { Link } from "react-router-dom";

class ViewCoupon extends PureComponent {
  state = {
    response: [],

  };


  renderTableData() {
    const Shivam = this.state.response;
    // console.log(Shivam.length)
    return Shivam.map((student) => {
      const {
        EXCHANGE,
        ISIN,
        Market_price,
        Annualized_yield,
        percent_change,
        Market_price_date
      } = student; //destructu
      // console.log(KYC_Id)

      return (
        <Tr>
          <Td class="pt-3-half" >
            {EXCHANGE}
          </Td>
          <Td class="pt-3-half" >
            {ISIN}
          </Td>
          <Td class="pt-3-half" >
            { Market_price}
          </Td>
          <Td class="pt-3-half" >
            {Annualized_yield}
          </Td>
          <Td class="pt-3-half">
            { percent_change}
          </Td>
          <Td class="pt-3-half" >
            { Market_price_date}
          </Td>


        </Tr>
      );
    });
  }
  render() {

    return (


<div className="">
<CardBody style = {{margin : '0px',padding : '0px'}}>
  <form
    className="form form--horizontal "
    style={{ margin: '0 auto!important',width : '100%' }}
   >

    <div className="card" style = {{width : '100%'}}>
      {/* <h3 className="card-header text-center font-weight-bold text-uppercase py-4">Editable table</h3> */}
      <div className="card-body" style = {{margin : '0px',padding : '0px'}}>
        <div id="table" className="table-editable" style = {{width : '75vw'}}>
          <span className="table-add float-right mb-3 mr-2" >
            <Link to={'/isinpriceadd'}  className="text-success"><i style = {{marginLeft : '20%'}} className="fas fa-plus fa-2x" aria-hidden="false"></i></Link><p style = {{marginRight : '2vw'}}>Add New</p></span>

          <Table className="table table-bordered table-responsive-md table-striped text-center">
            <Thead>
              <Tr>
                <Th className="text-center">Uploaded Files</Th>
                <Th className="text-center">Edit</Th>
                <Th className="text-center">Delete</Th>


              </Tr>
            </Thead>
            <Tbody>

          {this.renderTableData()}

            </Tbody>
          </Table>
        </div>
      </div>
    </div>
  </form>
</CardBody>
</div>
    );
  }
}

export default ViewCoupon;
